const [incompleteTodos, setIncompleteTodos] = useState<Todo[]>(JSON.parse(localStorage.getItem('incompleteTodos') || '[]'));

const [completeTodos, setCompleteTodos] = useState<Todo[]>(JSON.parse(localStorage.getItem('completeTodos') || '[]'));

useEffect(() => {
  localStorage.setItem('incompleteTodos', JSON.stringify(incompleteTodos));
  localStorage.setItem('completeTodos', JSON.stringify(completeTodos));
}, [incompleteTodos, completeTodos]);
